Emily was a noblewoman who lost her father&rsquo;s favor and even her life to her younger half-sister. She was killed by them and woke up in the past. Upon realizing this, she runs away from her noble family to save her life. However, while running away, she finds herself in danger of being kidnapped by an unknown assailant. But then, mysterious men who claim to be her &lsquo;father&rsquo; and &lsquo;brother&rsquo; suddenly appear?!

&ldquo;Take your hands off my daughter.&rdquo;
&ldquo;If you let my younger sister go, I&rsquo;ll spare your life.&rdquo;

&lsquo;My father isn&rsquo;t that young. And I don&rsquo;t have a brother&hellip;?&rsquo;
